import React from 'react';

class App extends React.Component{
  constructor(){
    super();
    this.state={
      name:"miku",
      email:"s@gmail.com",
      age:20
    };
  }


  render(){
    return(
      <>
      <h1> react js state</h1>
      <h2>Name:{this.state.name}</h2>
      <h2>Email:{this.state.email}</h2>
      <h2>Age:{this.state.age}</h2>
      </>
    )
  }
}
